message:
Falamos em Forças Armadas e vamos apenas para a porta dos quartéis do Exército e esquecemos que são três as entidades.
Exército - por terra;
Marinha - no mar;
Aeronáutica - no ar.
Então, os que estiverem distantes de quartéis do Exército, mas próximos aos quartéis das outras armas, reunam-se em frente a eles.
Segue também trecho da CF com art.142 onde explicita a Garantia da Lei e da Ordem - GLO
Segue o jogo!
RESISTÊNCIA CIVIL!!!
@Womentiras
